INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 101, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 110, 0.029, 1, 1, 0, 160, 1, 1.5, 1, 0, 122601);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (111, 102, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 105, 0.014, 2, 0, 1, 120, 3, 2.5, 2, 0, 122401);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 103, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 110, 0.017, 3, 0, 0, 350, 2, 2.5, 3, 1, 122501);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 104, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 110, 0.016, 4, 0, 1, 130, 3, 1.5, 4, 0, 107501);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 105, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 110, 0.014, 5, 1, 0, 160, 1, 2.5, 5, 0, 107601);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (103, 106, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 120, 0.029, 6, 0, 0, 255, 2, 3.5, 6, 1, 107801);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (103, 107, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 120, 0.013, 7, 1, 0, 160, 1, 3.5, 7, 0, 110601);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (103, 108, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 110, 0.014, 8, 0, 0, 350, 2, 2.5, 8, 1, 110401);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (100, 109, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 105, 0.012, 9, 0, 1, 130, 3, 1.5, 9, 0, 110501);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (103, 110, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 105, 0.014, 10, 1, 0, 200, 1, 2.5, 10, 0, 115701);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (103, 111, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 105, 0.071, 11, 0, 0, 350, 2, 2.5, 11, 1, 113601);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (103, 112, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 120, 0.014, 12, 0, 1, 130, 3, 1.5, 12, 0, 107901);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 113, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 110, 0.022, 13, 1, 0, 200, 2, 1.5, 13, 0, 108001);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (108, 114, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 110, 0.031, 14, 1, 0, 160, 1, 2.5, 14, 0, 110301);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 115, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 110, 0.036, 15, 0, 1, 130, 1, 0.5, 15, 0, 107701);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (95, 116, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 110, 0.048, 16, 0, 0, 350, 2, 3.5, 16, 1, 113101);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 117, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 105, 0.043, 17, 0, 1, 130, 3, 1.5, 17, 0, 113301);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (95, 118, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 105, 0.018, 18, 0, 1, 130, 2, 1.5, 18, 0, 113201);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (108, 119, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 110, 0.021, 19, 1, 0, 160, 2, 2.5, 19, 0, 117001);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 120, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 110, 0.036, 20, 0, 0, 255, 1, 2.5, 20, 1, 113501);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 121, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 105, 0.02, 21, 0, 0, 350, 3, 2.5, 21, 1, 113401);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 122, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 110, 0.018, 22, 0, 1, 130, 1, 2.5, 22, 0, 110101);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (111, 123, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 105, 0.03, 23, 1, 0, 160, 3, 3.5, 23, 0, 110001);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (103, 124, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 110, 0.027, 24, 0, 1, 130, 1, 1.5, 24, 0, 117201);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (108, 125, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 105, 0.02, 25, 1, 0, 160, 2, 3.5, 25, 0, 117301);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 126, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 110, 0.04, 26, 0, 0, 350, 3, 2.5, 26, 1, 117401);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 127, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 110, 0.009, 27, 0, 0, 350, 1, 3.5, 27, 1, 117101);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 128, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 120, 0.022, 28, 0, 0, 255, 1, 3.5, 28, 1, 122901);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, 129, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 110, 0.028, 29, 0, 1, 130, 3, 2.5, 29, 0, 122801);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (108, 130, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 105, 0.023, 30, 1, 0, 130, 2, 3.5, 30, 0, 122701);
